import { reqCategory } from '@/api/index.js'

//home的小仓库
const state = {
  categroyList: [],
  a: 1,
}
const mutations = {
  CATEGORYLIST(state, categroyList) {
    state.categroyList = categroyList
  },
}
const actions = {
  async categroyList() {
    let result = await reqCategory()
    if (result.code == 200) {
      commit('CATEGORYLIST', result.data)
    }
  },
}
const getters = {}

export default {
  state,
  mutations,
  actions,
  getters,
}
